$ErrorActionPreference='Stop'
$repo='C:/github/jagilber/obfuscate-mcp-server'
$hook = Join-Path $repo '.githooks/pre-commit'
$hookContent = if(Test-Path $hook){ Get-Content -Raw -Path $hook } else { '' }
# Extract quoted patterns
$patternList = [regex]::Matches($hookContent,'"([^"\n]+)"') | ForEach-Object { $_.Groups[1].Value } | Sort-Object -Unique

# Classify patterns roughly
$classes = @()
foreach($p in $patternList){
  $cat = switch -regex ($p){
    'AccountKey|SharedAccessSignature|InstrumentationKey|SAS|SAS' { 'azure-secret'; break }
    'subscriptions/' { 'azure-resource-id'; break }
    'ssn|social.security|\b\d{3}-\d{2}-\d{4}' { 'pii-identity'; break }
    'credit card|\b[0-9]{4}[[:space:]-]?[0-9]{4}' { 'pii-financial'; break }
    'email|@[A-Za-z0-9.-]+\.' { 'pii-contact'; break }
    'api[_-]?key|secret[_-]?key|private[_-]?key|password' { 'generic-secret'; break }
    '[0-9a-fA-F]{40}' { 'hash-or-thumbprint'; break }
    default { 'other' }
  }
  $classes += [pscustomobject]@{Pattern=$p;Category=$cat}
}

# Source scan
$codeDir = Join-Path $repo 'src'
$codeFiles = if(Test-Path $codeDir){ Get-ChildItem -Path $codeDir -Recurse -Include *.ts,*.js -File | Select-Object -First 80 } else { @() }
$secretRegex = '(?i)(api[_-]?key|client_secret|accountkey=|sharedaccesssignature|instrumentationkey=|password\s*[:=])'
$hits = @()
foreach($f in $codeFiles){
  $content = Get-Content -Raw -Path $f.FullName
  if($content -match $secretRegex){
    $lines = $content -split "`n"
    for($i=0;$i -lt $lines.Count;$i++){
      if($lines[$i] -match $secretRegex){
        $snippet = $lines[$i].Trim(); if($snippet.Length -gt 160){ $snippet = $snippet.Substring(0,160) }
        $hits += [pscustomobject]@{File=$f.FullName;Line=$i+1;LineText=$snippet}
      }
    }
  }
}

# Schema summary
$schemaDir = Join-Path $repo 'schemas'
$schemaFiles = if(Test-Path $schemaDir){ Get-ChildItem -Path $schemaDir -File -Include *.json } else { @() }
$schemaEntries = @()
foreach($sf in $schemaFiles){
  try { $raw = Get-Content -Raw -Path $sf.FullName; $json = $raw | ConvertFrom-Json -ErrorAction Stop } catch { continue }
  if($json -is [System.Collections.IEnumerable]){ $count = $json.Count } elseif($json.rules){ $count = $json.rules.Count } else { $count = 1 }
  $schemaEntries += [pscustomobject]@{File=$sf.Name;Entries=$count}
}

$result = [pscustomobject]@{
  HookPatternCount = $patternList.Count
  HookPatternCategories = $classes | Group-Object Category | ForEach-Object { [pscustomobject]@{Category=$_.Name; Count=$_.Count} }
  SecretHitsInCode = $hits
  SchemaFiles = $schemaEntries
}
$result | ConvertTo-Json -Depth 6

