# Test the full MCP client implementation
Set-Location "OBF_PATH"

# Remove any existing modules
Get-Module MCP* | Remove-Module -Force

# Import the full MCP client
Import-Module .\MCPClient.psm1 -Force

Write-Host "=== MCP Client Functions Available ===" -ForegroundColor Green
Get-Command -Module MCPClient

Write-Host "`n=== Testing MCP Client Connection ===" -ForegroundColor Green
try {
    # Test connection - this will actually try to connect to the MCP server
    Write-Host "Attempting to connect to powershell-mcp-server..." -ForegroundColor Yellow

    # First check if the server is available
    $mcpConfigPath = "$env:APPDATA\Code\User\mcp.json"
    if (Test-Path $mcpConfigPath) {
        $mcpConfig = Get-Content $mcpConfigPath -Raw | ConvertFrom-Json
        $server = $mcpConfig.servers.'powershell-mcp-server'
        Write-Host "Found server config:" -ForegroundColor Cyan
        Write-Host "  Command: $($server.command)" -ForegroundColor White
        Write-Host "  Args: $($server.args -join ' ')" -ForegroundColor White
        Write-Host "  Working Dir: $($server.cwd)" -ForegroundColor White

        # Check if the server directory and files exist
        if ($server.cwd -and (Test-Path $server.cwd)) {
            $serverFile = Join-Path $server.cwd $server.args[0]
            if (Test-Path $serverFile) {
                Write-Host "  Server file exists: $serverFile" -ForegroundColor Green

                # Try to connect (this might fail if server isn't ready)
                Connect-MCP -ServerName "powershell-mcp-server"
            } else {
                Write-Warning "Server file not found: $serverFile"
            }
        } else {
            Write-Warning "Server working directory not found: $($server.cwd)"
        }
    } else {
        Write-Warning "VS Code MCP config not found at $mcpConfigPath"
    }
}
catch {
    Write-Host "Connection test result: $($_.Exception.Message)" -ForegroundColor Red
    Write-Host "This is expected if the MCP server isn't built or running separately" -ForegroundColor Yellow
}

